import { Redirect, useHistory } from 'react-router-dom';
import './App.css'
const Home = () => {

    const handleChangeG =event =>{
        event.preventDefault();
        history.push('/generate');
    }
    const handleChangeS= event =>{
        event.preventDefault();
        <Redirect to ="/scan" />
    }
    return(
        <div  className="body">
            <h1 className="text-dark text-center bg-danger">Welcome</h1>
            <div className="row">
                <div className="col-md-6 text-center bg-dark ">
                    <h3 className="text-light">Generate Your Qr Code Here</h3>
                    <button type="button" onClick ={handleChangeG}className="btn btn-success btn-block p-2 mb-4 my-4 ml-2">Generate</button>

                </div>
                <div className="col-md-6 text-center bg-dark ">
                    <h3 className="text-light">Scan Your Qr Code Here</h3>
                    <button type="button" onClick ={handleChangeS }className="btn  btn-success btn-block p-2 mb-4 my-4 mr-2">Scan</button>

                </div>
            </div>
        </div>
    
)
    }

export default Home
